import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";
import { Link } from "react-router-dom";
import { FaCartPlus, FaUserCircle, FaBars, FaAmazonPay } from "react-icons/fa";
import logo from "./image/logo.png";
import "./style.css";
class Navigator extends Component {
  render() {
    return (
      <div className="App">
        <Navbar
          collapseOnSelect
          className=" ml-5 mr-5 "
          expand="lg"
          style={nav}
          variant="dark"
        >
          <Link to="/">
            <Navbar.Brand href="#home" style={all} className="text-dark ">
              <img
                className="image-responsive uj"
                style={img}
                src={logo}
                alt="Third slide"
              />
            </Navbar.Brand>
          </Link>
          <Navbar.Toggle
            aria-controls="responsive-navbar-nav"
            children={<FaBars />}
            style={col}
          />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
              {/* <Nav.Link href="Add" className="text-dark">
                Add Post
              </Nav.Link> */}
            </Nav>
            <Nav>
              <Nav.Link
                eventKey={2}
                href="#memes"
                style={(all, io)}
                className="text-dark"
              >
                <b className="lin">Market</b>
              </Nav.Link>
              <Nav.Link href="/" style={(all, io)} className="text-dark ">
                <b className="lin">
                  Cart &nbsp; <FaCartPlus />
                </b>
              </Nav.Link>
              <Nav.Link href="/about" style={(all, io)} className="text-dark ">
                <b className="lin">
                  Checkout &nbsp;
                  <FaAmazonPay />
                </b>
              </Nav.Link>
              <Nav.Link
                eventKey={2}
                href="#memes"
                style={(all, io)}
                className="text-dark"
              >
                <b className="lin">
                  SignIn &nbsp;
                  <FaUserCircle />
                </b>
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}

var io = {
  padding: "13px"
};

var all = {
  fontFamily: "comfortaa",
  fontWeight: "normal"
};

var col = {
  color: "black",
  fontSize: "27px"
};

var nav = {
  backgroundColor: "white"
};
var img = {
  width: "120px"
};
export default Navigator;
